import React from 'react';

export default function ReportsPage({ user }) {
    return ( <
        div className = "p-8 bg-white rounded-lg shadow-xl" >
        <
        h2 className = "text-3xl font-bold text-gray-800 mb-4" > Reports < /h2> <
        p className = "text-gray-700" > User Role: { user && user.role } < /p> <
        p className = "mt-4 text-gray-600" > This page would contain various reports and visualizations based on the data in the database. < /p> <
        /div>
    );
}
